function check(e,t){e.value!=document.getElementById(t).value?e.setCustomValidity("Las contraseñas deben coincidir"):e.setCustomValidity("")}function validationCI(e){e.value.length>e.maxLength&&(e.value=e.value.slice(0,e.maxLength)),e.value.length<e.maxLength?e.setCustomValidity("Cédula inválida"):e.setCustomValidity("")}